Abstract {#S1}
========

We present a model of the action of a group dynamics on a sequence of linear systems over a complete alphabet. As such we develop a model of a continuous linear system over the alphabet by an action of the group. We examine the possible consequences of these results and find good results in the framework of finite-dimensional automata, but also of finite groups.

Preliminaries {#ss1}
-------------

By a *synthesis* we mean a sequence of left, lower, and right-division linear systems over a set $\{1,2,\ldots\}$ acting from left to right
